import React, {Component, Fragment} from "react";
import {withRouter} from "react-router";

class Newest extends Component {
    constructor() {
        super();
        this.state = {}
    }

    render() {
        return (<Fragment><p>最新</p></Fragment>)
    }

}

export default withRouter(Newest);
